searchData={"items":[{"type":"module","title":"Identicon","doc":"Provides functions for generating identicons.","ref":"Identicon.html"},{"type":"function","title":"Identicon.build_image/1","doc":"Updates the Identicon Image struct by building a new grid from the input hex list.","ref":"Identicon.html#build_image/1"},{"type":"function","title":"Examples - Identicon.build_image/1","doc":"iex> Identicon.build_image(%Identicon.Image{hex: [116, 181, 101, 134, 90, 25, 44, 200, 105, 60, 83, 13, 72, 235, 56, 58]})\n    %Identicon.Image{\n      color: nil,\n      grid: [{116, 0},\n              {181, 1},\n              {101, 2},\n              {181, 3},\n              {116, 4},\n              {134, 5},\n              {90, 6},\n              {25, 7},\n              {90, 8},\n              {134, 9},\n              {44, 10},\n              {200, 11},\n              {105, 12},\n              {200, 13},\n              {44, 14},\n              {60, 15},\n              {83, 16},\n              {13, 17},\n              {83, 18},\n              {60, 19},\n              {72, 20},\n              {235, 21},\n              {56, 22},\n              {235, 23},\n              {72, 24}],\n        hex: [116, 181, 101, 134, 90, 25, 44, 200, 105, 60, 83, 13, 72, 235, 56, 58]}","ref":"Identicon.html#build_image/1-examples"},{"type":"function","title":"Identicon.build_pixel_map/1","doc":"Updates the Identicon Image struct with a new pixel_map field.","ref":"Identicon.html#build_pixel_map/1"},{"type":"function","title":"Examples - Identicon.build_pixel_map/1","doc":"iex> Identicon.build_pixel_map(%Identicon.Image{color: [116, 181, 101], grid: [{116, 0}, {134, 3}, {90, 4}, {44, 6}, {200, 7}, {60, 9}, {72, 12}, {56, 14}, {58, 15}]})\n    %Identicon.Image{\n              color: [116, 181, 101],\n              grid: [{116, 0}, {134, 3}, {90, 4}, {44, 6}, {200, 7}, {60, 9}, {72, 12}, {56, 14}, {58, 15}],\n              hex: nil,\n              pixel_map: [\n                {{0, 0}, {50, 50}},\n                {{150, 0}, {200, 50}},\n                {{200, 0}, {250, 50}},\n                {{50, 50}, {100, 100}},\n                {{100, 50}, {150, 100}},\n                {{200, 50}, {250, 100}},\n                {{100, 100}, {150, 150}},\n                {{200, 100}, {250, 150}},\n                {{0, 150}, {50, 200}}\n              ]\n            }","ref":"Identicon.html#build_pixel_map/1-examples"},{"type":"function","title":"Identicon.draw_image/2","doc":"Draws the image and saves it to a file with the input string as the file name under the folder ./identicons.{name}.png.\nUses the :egd save implements to save the binary file to the location specified.","ref":"Identicon.html#draw_image/2"},{"type":"function","title":"Examples - Identicon.draw_image/2","doc":"iex> Identicon.draw_image(%Identicon.Image{color: [116, 181, 101], pixel_map: [{{0, 0}, {50, 50}}, {{150, 0}, {200, 50}}, {{200, 0}, {250, 50}}, {{50, 50}, {100, 100}}, {{100, 50}, {150, 100}}, {{200, 50}, {250, 100}}, {{100, 100}, {150, 150}}, {{200, 100}, {250, 150}}, {{0, 150}, {50, 200}}]}, \"elixir\")\n    :ok","ref":"Identicon.html#draw_image/2-examples"},{"type":"function","title":"Identicon.filter_odd_squares/1","doc":"Updates the Identicon Image struct by filtering the grid field to only include the even numbers.","ref":"Identicon.html#filter_odd_squares/1"},{"type":"function","title":"Examples - Identicon.filter_odd_squares/1","doc":"iex> Identicon.filter_odd_squares(%Identicon.Image{grid: [{116, 0}, {181, 1}, {101, 2}, {134, 3}, {90, 4}, {25, 5}, {44, 6}, {200, 7}, {105, 8}, {60, 9}, {83, 10}, {13, 11}, {72, 12}, {235, 13}, {56, 14}, {58, 15}]})\n    %Identicon.Image{color: nil, grid: [{116, 0}, {134, 3}, {90, 4}, {44, 6}, {200, 7}, {60, 9}, {72, 12}, {56, 14}, {58, 15}], hex: nil}","ref":"Identicon.html#filter_odd_squares/1-examples"},{"type":"function","title":"Identicon.hash_input/1","doc":"Hashes the input string and returns an updated `Identicon.Image` struct with the hashed input as the value for the `hex` field.","ref":"Identicon.html#hash_input/1"},{"type":"function","title":"Examples - Identicon.hash_input/1","doc":"iex> Identicon.hash_input(\"elixir\")\n    %Identicon.Image{hex: [116, 181, 101, 134, 90, 25, 44, 200, 105, 60, 83, 13, 72, 235, 56, 58]}","ref":"Identicon.html#hash_input/1-examples"},{"type":"function","title":"Identicon.main/1","doc":"The main function that takes an input string and returns an Identicon image.\nReturns an Identicon image, with the :ok atom if the image was successfully saved to a file.","ref":"Identicon.html#main/1"},{"type":"function","title":"Examples - Identicon.main/1","doc":"iex> Identicon.main(\"elixir\")\n    :ok","ref":"Identicon.html#main/1-examples"},{"type":"function","title":"Identicon.mirror_image/1","doc":"Mirrors the input list and returns a new list with the mirrored elements appended to the original list.","ref":"Identicon.html#mirror_image/1"},{"type":"function","title":"Examples - Identicon.mirror_image/1","doc":"iex> Identicon.mirror_image([116, 181, 101])\n    [116, 181, 101, 181, 116]","ref":"Identicon.html#mirror_image/1-examples"},{"type":"function","title":"Identicon.pick_color/1","doc":"Picks the first three elements from the input list and updates the Identicon Image stuct with the new image field.","ref":"Identicon.html#pick_color/1"},{"type":"function","title":"Examples - Identicon.pick_color/1","doc":"iex> Identicon.pick_color(%Identicon.Image{hex: [116, 181, 101, 134, 90, 25, 44, 200, 105, 60, 83, 13, 72, 235, 56, 58]})\n      %Identicon.Image{hex: [116, 181, 101, 134, 90, 25, 44, 200, 105, 60, 83, 13, 72, 235, 56, 58], color: [116, 181, 101], grid: nil}","ref":"Identicon.html#pick_color/1-examples"},{"type":"module","title":"Identicon.Image","doc":"","ref":"Identicon.Image.html"}],"content_type":"text/markdown"}